import React, {Component}  from 'react';

import Cell from './Cell'; // Import a component from another file

class Board extends Component {

  render(){
      return(
         <div className="board">
          <div className="row">
          <Cell game_board = {this.props.game_board}/>
          <Cell />
          <Cell />
          </div>
          <div className="row">
          <Cell />
          <Cell/>
          <Cell/>
          </div>
          <div className="row">
          <Cell/>
          <Cell/>
          <Cell/>
          </div>

        </div>


      );
  }
}

export default Board;
